        <i class="far fa-newspaper"></i>
        <span className="link-text">News</span>
        </a>
      </li>
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i class="far fa-newspaper"></i>
        </a>
      </li>
    </ul>
    <style jsx>
      {`
      .navbar{
        width: 5rem;
        height: 100vh;
        position:fixed;
        background-color: #2A2E35;
      }
      .navbar-nav{
        list-style: none;
        padding: 0;
        margin: 0;
        display: flex;
        flex-direction: column;
        align-itmes: center;
      }
      .nav-item{
        width: 100%;
      }
      .nav-item:last-child{
        margin-tom:auto;
      }
      .nav-link{

      }
      `}
    </style>
  </nav>
);

export default Navbar;
